// TableCol.tsx
import React from "react";

const TableCol = ({ row, field, format }) => {
  const value = typeof field === "function" ? field(row) : row[field]; // Use selector function if provided
  const formattedValue = format ? format(row) : value;
  return (
    <div>
      {formattedValue && formattedValue.length > 100
        ? formattedValue.substring(0, 100) + "..."
        : formattedValue}
    </div>
  );
};

export default TableCol;
